import React from "react";
import "../styles/nav.css"
export default function Navbar(){
    const[userData,setUserData]=React.useState()
    const [error, setError] = React.useState(undefined)
    React.useEffect(() => {
        fetch("http://refertest.pythonanywhere.com/user/data")
          .then((res) => res.json())
          .then((json) => {
            console.log(json);
            setUserData(json);
            // setLoading(false);
          })
          .catch((err) => {
            console.log(err);
            setError(err.message);
            console.log(error);
            // setLoading(false);
          });
      }, []);
      console.log(userData)
    return(
    <div className="nav">
        <h1 className="nav-el">ABC Jobs</h1>
        <div className="user">
            <img src={userData.data.pictureUrl} alt="dp"/>
            <span className="name">{userData.dadta.name} student of {userData.data.college}</span>

        </div>
    </div>)
}
